import React from 'react';
import './css/login.css';
import B from './img/b.png';

class Login extends React.Component {
  render() {
    return (
    	<form className="form-signin login-f">
		  <div className="text-center mb-4">
		    <img className="mb-4" src={B} alt="" width="72" height="72"/>
		    <h1 className="h3 mb-3 font-weight-normal">Shopping</h1>
		    <p>Build form controls with floating labels via the <code>:placeholder-shown</code> pseudo-element. <a href="https://caniuse.com/#feat=css-placeholder-shown">Works in latest Chrome, Safari, and Firefox.</a></p>
		  </div>

		  <div className="form-label-group">
		   <label for="inputEmail">Correo electronico</label>
		    <input type="email" id="inputEmail" className="form-control" placeholder="Email address" required autofocus/>
		   
		  </div>

		  <div className="form-label-group">
		  <label for="inputPassword">Contrase√±a</label>
		    <input type="password" id="inputPassword" className="form-control" placeholder="Password" required/>
		    
		  </div>

		  <div className="checkbox mb-3">
		    <label>
		      <input type="checkbox" value="remember-me"/> Recuerdame
		    </label>
		  </div>
		  <button className="btn btn-lg btn-primary btn-block" type="submit">Ingresar</button>
		  <p className="mt-5 mb-3 text-muted text-center">&copy; 2017-2020</p>
		 </form>
    );
  }
}

export default Login;
